measurements.description:
One striking large flower on one 19.5-cm inflorescence; 
   sepals white overlaid light green centrally, boldly striped dark green;
   petals hirsute, light golden yellow striped dark green, spotted dark mahogany along top edge, suffused rose distally;
   pouch green suffused dark rose, dark green venation; staminode green;
   substance firm; texture matte.
